import React from 'react';

const Timer = (props) => {
  return (
    <div className={props.hide ? '.d-none' : ''}>
      <h4>{props.timer}</h4>
      <div>
        Too much pressure ? <br />
        <button className="btn btn-dark btn-sm mr-auto">Hide Timer</button>
      </div>
    </div>
  )
}

export default Timer;
